    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Alaska Peninsula and Becharof NWRs for the next
    15 years. This plan outlines the refuges' vision and purpose and describes how Alaska
    Peninsula and Becharof NWRs will contribute to the overall mission of the Refuge
    System. The plan provides an introduction to the refuges, refuge goals and objectives,
    management policies, implementation and monitoring strategies, step-down plans,
    a public use management plan, and partnership opportunities. Key planning issues
    include: habitats, fish and wildlife populations, public use, water, and environmental
